import React from 'react';
import { Box, Button, Grid, Typography } from '@mui/material';

const Portfolio = () => {
  return (
    <Box sx={{
      backgroundColor: 'background.default', // Use theme color
      minHeight: '100vh',
      minWidth: '100vw',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
    }}>
      <Typography variant="h3" gutterBottom>My Portfolio</Typography>
      <Grid container spacing={2} justifyContent="center">
        <Grid item xs={12} sm={6}>
          <Button variant="contained" fullWidth onClick={() => {/* navigate to Work Experience */}}>
            Work Experience
          </Button>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Button variant="contained" fullWidth onClick={() => {/* navigate to Projects */}}>
            Projects
          </Button>
        </Grid>
      </Grid>
    </Box>
  );
};

export default Portfolio;
